description:
Andre is a 1994 feature film starring Tina Majorino about a child's encounter with a seal. The film is an adaptation of the book A Seal Called Andre, which in turn was based on a true story.

Toni Whitney, a nine-year-old girl, and her Rockport, Maine family adopt an orphaned baby seal, naming it Andre. Andre is manageable when he is young but as Andre gets older and starts getting into mischief, he antagonizes some of the local fishermen. Toni forms an inseparable bond with Andre, but their relationship becomes threatened when the fishermen do not want to deal with Andre's antics any longer. &lt;a href=&quot;
